INSERT INTO `page` VALUES (3,'testing-page','testing page','<ol>\r\n	<li>The most important benefit of this scheme is the lowest possible cost: The property cost is reduced upto 20% or even lesser than the prevailing market rate.</li>\r\n	<li>Applicants have choice regarding the desirable location of a plot: e.g. nearest to a railway station, mall, highway, hospital, school, airport, famous market, industrial premises, public places, government&rsquo;s special offices or any specified location, etc.</li>\r\n	<li>Building design and flooring satisfy the applicant&rsquo;s budget and demands. The applicant can decide on common amenities and exterior of the building i.e., Lift, gym, society office, entrance, parking, water supply, lights, swimming pool, garden, elevation of building, lobby, grill, door bell, TV connection, internet connection, etc. The budget is fixed as per the demand.</li>\r\n	<li>According to the budget and choice, the applicant can decide the interiors of the property i.e., Door, safety door, tiles, colour, bathroom door, plumbing, water tap, tub bath, WC, electrical supply &amp; lighting arrangement , window, kitchen tiles, etc. Moreover, all these will be according to the applicant&rsquo;s choice &amp; budget.</li>\r\n	<li>As most of the bookings have already been confirmed, applicants can be rest assured that the project will be completed as per the schedule.</li>\r\n	<li>The land required for the project is purchased only after careful investigation of the title by legal experts under the supervision of the promoter, who has sound technical knowledge and considerable experience.</li>\r\n	<li>The value of the land is fixed by the veteran promoter (builder) having up-to-date knowledge of the current market rate, conditions, and the overall market scenario. Hence, the land for the &lsquo;proposed building project&rsquo; is acquired at a lesser rate, by avoiding possible disputes &amp; cheating, the factors the applicant is most apprehensive about. Thus, the factors which can stop smooth project execution are properly observed then taken care of and the potential cost escalation resulting from those factors are avoided. This greatly helps in keeping the cost of land to the minimum possible level and thereby helps to reduce the property cost &amp; the project cost, too.</li>\r\n	<li>Construction of the property which is technically fit and strong. The promoter&rsquo;s professional experience helps to choose the construction material, i.e. steel, cement, sand, etc.; water; and skilled &amp; unskilled labour of the best quality and at a lesser than usual cost with strong technical support.</li>\r\n	<li>With the details provided by the applicant, the budget is easily set and eligibility for the loan amount is confirmed by the experts of a financial institution before the booking is done. This greatly helps the applicant to save him from the unfortunate circumstance of having to cancel the booking due to unavailability of loan.</li>\r\n	<li>You can easily search for the property from any corner of the world. No need to travel daily in search of property at different locations with different rates and different builders.</li>\r\n</ol>\r\n'),(4,'baviskarseva','baviskarseva','<p>Dear Sir,<br />\r\nAs discussed over call, we will be implementing a new proposed payment option as described below:<br />\r\n1. We will create an additional page for generating an unique code.<br />\r\n&nbsp;&nbsp;&nbsp; a. This page will be accessible only with credentials(username/password). A separate URL will be provided to access the page.<br />\r\n&nbsp;&nbsp;&nbsp; b. Page will have following items to capture information:<br />\r\n&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; i.&nbsp;&nbsp; Name of application.<br />\r\n&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; ii.&nbsp; Mobile number of applicant<br />\r\n&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; iii. Email id of applicant.<br />\r\n&nbsp;&nbsp;&nbsp; c. This screen will have one more button to generate the unique id. On clicking of the button system will generate an unique id and display it on screen.<br />\r\n&nbsp;&nbsp;&nbsp; d. The generated unique id will be sent to applicant&#39;s email id.<br />\r\n&nbsp;&nbsp;&nbsp; e. Officer from ProposedSociety will be able to either take a print or can look at the generated code on screen and provide on a paper manually.<br />\r\n2. Applicant will need to go to ProposedSociety.com website to fill the form, on reaching the payments page after filling all the form details, our website will show one more option in payment: &#39;Payment using the code&#39;. If this option is selected a text box will appear to enter the generated code.<br />\r\n3. Application will verify the code and make the payment successful on verification. Once the code is used the same code will not be available for any further payment.<br />\r\n<br />\r\n<strong>Note:</strong> On payment page, a note will be displayed: &#39; Note : Payments through NetBanking and Credit/Debit card is temporary unavailable . Please deposit the fees in the bank A/C details provided below OR use the code provided while making cash payment.&#39;</p>\r\n\r\n<p>&nbsp;</p>\r\n'),(5,'static-page','Static Page','<p>Hi&nbsp;All,</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; I hereby informed that, we can create update delete pages so enjoy by doing so.</p>\r\n\r\n<p>&nbsp;</p>\r\n'),(7,'proposed','proposed','<p>test&nbsp;</p>\r\n'),(8,'concept','Our Concept','<p>The most important criterion and also the major concern for a property buyer is the minimum property cost with expected amenities and facilities. The potential buyer intends to purchase property at the least possible cost with fulfillment of all expected property demand and therefore tries various methods such as; (a) individually purchasing a plot and construct the property (b) A group of interested people comes together who then form a society and develop the property (c) Purchasing under-construction or ready possession property from the builder. These are the three traditional methods to purchase property. However all these abovesaid methods still do not completely satisfy the cost criterion and all the expected property demand of the buyer. It is this aspect, minimum cost, the affordability and fulfillment of all the expected amenities and facilities that differentiates the concept &lsquo;Builder society&rsquo;s Promoter&rsquo;. It is such an innovative concept and method to construct property that the property cost can be reduced by upto twenty percent or more than the prevailing market rate at that time with the same amenities and the same location.</p>\r\n\r\n<p>Under this concept, we obtain all necessary information online, through the application form available on our website. We ask for the personal basic information of the interested applicants, complete &amp; detailed information about their income, investments and loans in the market, desired property to be purchased, expected location and required amenities &amp; facilities. At the time of accepting the application, as a company policy, while carrying out a survey company does not act as a promoter. We does not reveal information about any proposed building under the scheme or about any amenities, about any title documents in respect of any lands, or about any proposed building plan until we act as promoter.</p>\r\n\r\n<p>Applicants who have opted for the same location and the same amenities are scrutinized or called together for a discussion. If required applicants are personally interviewed with a view to assess &amp; understand their financial capacity, and to understand &amp; solve their personal difficulties. Until this stage, no consideration or booking amount in respect of any property is taken from applicants, except for a nominal registration fee of Rs 500 (Rupees five hundred only). In addition, no commission is given to the agent, as the project is not finalized until all applications have been scrutinized. Further, a careful &amp; definitive study is conducted on the demands of the applicants such as the expected location, common amenities &amp; facilities, and on their financial capacity.</p>\r\n\r\n<p>Through this process of application scrutinizing and study, a list of eligible applicants is finalised. Before taking any amount from these selected applicants or confirming any booking, the promoter purchases the required land for the project, fulfills the requisite legal formalities as per the provisions of the applicable laws, confirms the amenities and facilities of the projects according to the common demands of the applicants, and gets the plan of the plot of the purchased land approved. It is only after this stage that the promoter takes any booking amount or consideration.</p>\r\n\r\n<p>After ensuring compliance with the laws applicable to the project, the company informs individual purchasers (i.e. selected applicants) about all aspects of the project such as amenities &amp; facilities, approved plan, clean and clear title, etc. Further, the company resolves the doubts of the applicants, if any, about the proposed project. Then the company starts collecting the booking amount, cost of land and construction cost when it acts as a promoter. If seventy five percent of the proposed applicants will be bearable to pay the proportionate land cost and if they demanded to form the society first accordingly society can be formed, and the further processing and construction is undertaken as they decide.</p>\r\n\r\n<p>As a company policy, we confirm the group of purchasers before starting the project. Then the purchaser&rsquo;s eligibility for loan amount is assessed by financial institutions according to the purchaser&rsquo;s financial capacity. As a result, at the time of personal interview with individual applicants and which the help of provided information in application the total funds available with them can be confirmed. This ensures availability of sufficient funds, as per the budget, and eliminates the possibility of financial obstacles hindering smooth completion of the proposed project. Moreover, because the land cost and the construction cost of the project are recovered within the stipulated time period, the interest burden on the project is reduced upto twenty percent or less than twenty percent; the project cost also reduces accordingly.</p>\r\n\r\n<p>The entire procedure mentioned above is exclusively carried out under the supervision of an experienced and highly competent promoter/builder having sound technical knowledge and team, sufficient funds, large network in the real estate sector, requisite construction facilities &amp; equipment. This approach paves the way for us to smoothly and successfully execute the project. The property is constructed within a scheduled time, which also helps to reduce the property cost.</p>\r\n\r\n<p>This concept was implemented in the year 2009. According to this concept, two buildings have been constructed at the expected lowest cost, and the local planning authority has issued the occupancy / completion certificates for them. The projects developed under this concept have been felicitated and nominated for the prestigious MCHI &ndash; CREDAI Award and the CNBC Award and also as the top two projects in India.</p>\r\n'),(9,'benefits','Benefits of Concept','<ol>\r\n	<li>The most important benefit of this concept is the lowest possible cost: The property cost is reduced upto 20% or even lesser than the prevailing market rate.</li>\r\n	<li>Applicants have choice regarding the desirable location of a plot: e.g. nearest to a railway station, mall, highway, hospital, school, airport, famous market, industrial premises, public places, government&rsquo;s special offices or any specified location, etc.</li>\r\n	<li>Building design and flooring satisfy the applicant&rsquo;s budget and demands. The applicant can decide on common amenities and exterior of the building i.e., Lift, gym, society office, entrance, parking, water supply, lights, swimming pool, garden, elevation of building, lobby, grill, door bell, TV connection, internet connection, etc. The budget is fixed as per the demand.</li>\r\n	<li>According to the budget and choice, the applicant can decide the interiors of the property i.e., Door, safety door, tiles, colour, bathroom door, plumbing, water tap, tub bath, WC, electrical supply &amp; lighting arrangement , window, kitchen tiles, etc. Moreover, all these will be according to the applicant&rsquo;s choice &amp; budget.</li>\r\n	<li>As most of the bookings have already been confirmed, applicants can be rest assured that the project will be completed as per the schedule.</li>\r\n	<li>The land required for the project is purchased only after careful investigation of the title by legal experts under the supervision of the promoter, who has sound technical knowledge and considerable experience.</li>\r\n	<li>The value of the land is fixed by the veteran promoter (builder) having up-to-date knowledge of the current market rate, conditions, and the overall market scenario. Hence, the land for the &lsquo;proposed building project&rsquo; is acquired at a lesser rate, by avoiding possible disputes &amp; cheating, the factors the applicant is most apprehensive about. Thus, the factors which can stop smooth project execution are properly observed then taken care of and the potential cost escalation resulting from those factors are avoided. This greatly helps in keeping the cost of land to the minimum possible level and thereby helps to reduce the property cost &amp; the project cost, too.</li>\r\n	<li>Construction of the property which is technically fit and strong. The promoter&rsquo;s professional experience helps to choose the construction material, i.e. steel, cement, sand, etc.; water; and skilled &amp; unskilled labour of the best quality and at a lesser than usual cost with strong technical support.</li>\r\n	<li>With the details provided by the applicant, the budget is easily set and eligibility for the loan amount is confirmed by the experts of a financial institution before the booking is done. This greatly helps the applicant to save him from the unfortunate circumstance of having to cancel the booking due to unavailability of loan.</li>\r\n	<li>You can easily search for the property from any corner of the world. No need to travel daily in search of property at different locations with different rates and different builders.</li>\r\n</ol>\r\n'),(10,'rules','Rules & Regulations','<ol>\r\n	<li>Under the said concept, property is offered at upto twenty percent lesser cost than the existing market rate at that time for the same location and amenities. Therefore, it is imperative for the buyer to pay a proportionate land cost.</li>\r\n	<li>For applicants who fail to make the initial payment of proportionate land cost, the effective cost of the property will be governed by the initial payment made by them; the lower the initial payment, the higher the cost, and vice versa, when we start to act as promoter or builder.</li>\r\n	<li>The area of the property is subject to change (proposed committed area) by about 50 to 100 sq. ft, as it depends upon the final plan approval by the planning authority or the local sanctioning authority of government/municipal corporation. Therefore, the buyer will have to pay the excess amount accordingly.</li>\r\n	<li>The buyer is required to pay other charges such as development charges, infrastructure charges, proportionate charges of stamp duty and registration fee for the purchased plot, stamp duty and registration fee of the flat, society formation charges, deposits, government tax, service tax, VAT, all tax, fee for obtaining no-objection certificates and permission, electricity charges, water charges, consultation fee, proposed government charges, etc. when we act as promoter.</li>\r\n	<li>The property cost depends upon the amenities demanded. The cost will increase/decrease with an increase/decrease in the amenities. If a applicant wants additional work to be carried out in the property booked by him/her or demands additional amenities other than those provided by the company, the applicant will have to pay the additional charges in advance. Additional amenities such as a gym, society office, swimming pool, play ground, garden, area for playing indoor/outdoor games, common hall, etc. will increase the property cost. The company will declare amenities at the time of fixing the rate.</li>\r\n	<li>The company will provide the quotation for the proposed construction after considering the loan capacity and the financial capacity of the buyer. The buyer can obtain a tentative loan sanction letter from a bank by presenting his income proof to a financial institution. The company will not provide any documents of the plot for getting the loan sanctioned. Before confirming the booking, the company will issue a quotation for the property that is required for loan sanction and/or for withdrawing amount from the PF account. The buyer will get documents/sale agreement registered only after paying the booking amount.</li>\r\n	<li>The area which is covered by overhead slab will be considered as the carpet area, and the area which is not so covered will be considered as the terrace area.</li>\r\n	<li>The property will be allotted only after confirming the applicant&rsquo;s financial capacity to make payment; other than the initial amount of land cost or the amount paid by him/her at the time of booking by way of loan, FD, or cash. For this, the applicant is required to submit written proof in the office of our company, failing which the allotment letter and agreement for sale will not be provided.</li>\r\n	<li>After approval of the plan, the builder, society, or local government body can do the inevitable changes. The company reserves the right to change the construction of building to overcome the drawbacks as it done by the architect and consultant at the time of plan sanction.</li>\r\n	<li>The company reserves its right to allot a property on the first come, first served basis or as per the draw system or according to chronology (i.e. the applicant who completes all the formalities first is given a preference) or as per the company&rsquo;s operational convenience.</li>\r\n	<li>The company does not entertain any kind of transfer of interest or transfer of title, of whatsoever nature, from the applicant&mdash;or from the person in whose name the property is booked to anyone, and the company will not hand over the possession of the said property until the applicant makes the entire payment of the property cost and all other charges.</li>\r\n	<li>The buyer is liable to pay the maintenance charges, property tax, and government charges from the date of Completion Certificate given by the architect. In case of any delay in handing over the possession of the property due to the buyer&rsquo;s problems, the buyer is liable to pay the said charges.</li>\r\n	<li>Once the property is booked/confirmed by the applicant, the applicant will not be allowed to exchange the same for any reason. Although acting in goodwill, the company seeks to provide help as per the availability of properties. It is the company&rsquo;s sole discretion and not the buyer&rsquo;s right.</li>\r\n	<li>The amount paid for the application form is non-refundable, even in the case of cancellation of the application from.</li>\r\n	<li>If the construction cost increases due to some reasons such as natural calamities, an increase in the rates of building materials, or the rate increases as per government rules and regulations&mdash;the excess amount will be recovered from the customer, and the customer is liable to pay such excess amount.</li>\r\n	<li>If the buyer wants to cancel the registered agreement, the amount will be reimbursed after deducting the twenty percent amount of the total cost.</li>\r\n	<li>Company reserves the right to change the terms and conditions of this scheme in the future.</li>\r\n	<li>An applicant can download the Application Form from our website or fill up the form online. It is mandatory to deposit 500/- as Processing Fee/Application Fee through online transfer. Only those who have paid this fee and filled the application form properly will be considered and be eligible for the draw.</li>\r\n	<li>The rates of property provided in this scheme are valid only until the land for the project is purchased. Thereafter, the rates will be as per the prevailing market rate.</li>\r\n</ol>\r\n'),(11,'terms_and_conditions','Applicants Terms & Conditions','<ol>\r\n	<li>The applicant applying for this concept must be of sound mind and of or above 18 years of age.</li>\r\n	<li>Application for the concept is to be made online, through the form available on our website, and it is mandatory to pay the stipulated non-refundable form&ndash;processing fee of five hundred rupees per application along with the application form.</li>\r\n	<li>Until the form&ndash;processing fee of five hundred rupees is paid the application shall be treated as invalid.</li>\r\n	<li>The applicants can withdraw their applications if and when they so desire but processing fees partly or fully of five hundred rupees shall not be refunded. However, once the application is withdrawn, the applicant shall not be eligible to reapply within one month from the date of withdrawal, and the company shall not give priority to their fresh applications over the existing valid applications of other eligible applicants.</li>\r\n	<li>Only one application per applicant will be accepted; the application will be valid only for a single property.</li>\r\n	<li>The applicants whose applications have been cancelled, rejected or withdrawn as per the terms &amp; conditions of the company shall be eligible to reapply only after 30 days from the date of the cancellation of their applications.&nbsp;</li>\r\n	<li>It is mandatory for the applicant even again to pay the non-refundable form processing fee of Rupees five hundred only while reapplying for the concept.</li>\r\n	<li>Although the applicant has paid the consideration amount partly or fully, the applicant will be treated as applicant and not as applicant until is allotted with property.</li>\r\n	<li>The applicants will be declared as applicant&rsquo;s of the proposed society after the budget has been fixed and property allotment has been confirmed.</li>\r\n	<li>The applicants need to check the status of their respective applications for the concept atleast once in three months; otherwise, it will be deemed that the applicants are not interested in the scheme and their applications are liable to be cancelled. Hence, applicant has to re-apply and one shall be treated as new applicant.</li>\r\n	<li>Applicant need to fill mandatory information initially to register but to complete the process, applicant needs to fill complete application form within 30 days of registration or else application will not be considered as a valid application.</li>\r\n</ol>\r\n'),(12,'success_story','Success Story of Concept','<p>M/s. Bhawani Vikasak India Pvt. Ltd. signifies a novel, insightful concept&mdash;a vision&mdash;turned into reality by its visionary Founder and Managing Director. A man of keen insight managing director Mr. Prakash Baviskar, perceived the deficiencies in the traditional methods of acquiring property. Motivated by a vision to provide desired property at the lowest price, he endeavoured to develop novel and valuable ideas to fulfil his vision. The enterprising efforts of this illustrious man culminated in an innovative concept &ldquo;Builder Society&rsquo;s Promoter&rdquo;.</p>\r\n\r\n<p>This concept was introduced in a press conference at Vashi in the year 2009 and achieved great success and appreciation from all. Encouraged by this success, the company placed an advertisement in reputed newspapers. The advertisement provided a big and unique opportunity for the common people to buy a property at the lowest value; otherwise, property is usually an out-of-reach dream for the common man. Herein lies the uniqueness, greatness and the authenticity of this concept.</p>\r\n\r\n<p>The concept was well understood and in a very short time became popular among the people. Its huge success was vividly demonstrated by the fact that even in the economic crisis, thousands of people applied for property under this concept. All the received applications were scrutinised and studied to determine the eligibility of applicants for loan, and budgets were fixed for eligible applicants. The eligible applicants were then personally interviewed. Based on the interview results, their applications were filtered and sorted on the basis of similarity between the location and the budget, and a conference of only those potential applicants was organised Further, through the company, a plot of land was purchased, and legal formalities were completed for securing the necessary permissions and approvals. The required loan was also secured, and according to the individual choices, expectations and requirements of the purchasers, the proposed houses were planned.&nbsp;</p>\r\n\r\n<p>Most of the amount of the valued price of land was recovered within a limited period of time. Because the loans of the individual applicants were already sanctioned, the builder had sufficient funds to start the construction. Thus, in the implementation of the concept, financial concerns did not pose any hindrance, and projects were completed within the specified time period. As a result, the company achieved a great success in handling over the possession of the respective properties to their owners within time.</p>\r\n\r\n<p>By using this novel approach outlined above, the concept achieved remarkable success and popularity in providing property at a lesser price than the prevailing market rate. It is noteworthy that the project was nominated for the prestigious&nbsp;<strong>MCHI &ndash; CREDAI</strong>&nbsp;Real Estate Award 2012 and the CNBC award. This innovative concept proved to be immensely valuable not only to the people but also to our company: The company has been felicitated and ranked among the top two companies in India for providing property at the lowest possible price.</p>\r\n'),(13,'history','History','<p>M/S. Bhawani Vikasak (I) Pvt. Ltd. was established on 22nd March 2000 with a special purpose, namely to provide homes at an affordable rate to the common man and workers of the Municipal Corporation, Navi Mumbai, thereby solving the financial difficulties they faced in acquiring a home.&nbsp;</p>\r\n\r\n<p>The company&rsquo;s first project was successfully completed at Airoli, Navi Mumbai. Subsequently, the company even succeeded in providing homes at affordable rate to the common man and municipal transport workers at Kamothe, Navi Mumbai.</p>\r\n\r\n<p>Thereafter, the projects for common man, along with luxurious amenities and facilities, were implemented under this concept. It must be noted that occupancy certificates have been given to the purchasers of the projects completed so far. Similarly, because in all these projects, co-operative housing societies have been established and registered; the ownership of the land has also been transferred to the respective societies.</p>\r\n\r\n<p>The integrity of our company and the uniqueness &amp; success of the concept is underlined by the fact that all property buyers are satisfied, and the company has no litigation from any of the buyers so far.</p>\r\n\r\n<p>One&rsquo;s own home is his/her most cherished dream waiting to be materialised. However, for the common man, it is a distant dream. It is one thing to provide homes to those dreaming of it and who can afford to buy one with a little financial help, and it is quite different&mdash;diametrically opposite&mdash;to provide homes to those who never dream of one as they know they cannot afford to even dream of it. Herein lies our uniqueness and this is what makes us one of the respectable companies in the Indian real estate market. Right since its inception, our company has been paying all government taxes, complying with legal requirements and has been free from all hindrances.</p>\r\n\r\n<p>From time to time, the company has conducted in-depth market research with the special purpose of providing home at the lowest possible cost. The company has immensely benefited from the rich experience and vision of its Managing Director in the public sector and business; all its functions are streamlined and well-documented and are carried out according to the established procedures. As a result, the company has obtained the prestigious ISO 9001-2008 certification and is a respectable entity in the real estate market.</p>\r\n');
